// 関連するコンポーネントのみimportのコードをデモコードからコピーしてくる
import React from "react";
import List from "@material-ui/core/List";
import Divider from "@material-ui/core/Divider";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import MailIcon from "@material-ui/icons/Mail";
import { IconButton } from "@material-ui/core";

// function名をSidemenuとする
export function Sidemenu() {
  return (
    // 複数のエレメントを返すのでReact.Flagment（<></>）で囲む
    <>
      <a href="/rss.xml" aria-label="rssへのリンク">
        <IconButton aria-label="rssアイコン" color="default">
          <RssFeedIcon />
        </IconButton>
      </a>
      <a
        href="https://github.com/sadnessOjisan/blog.ojisan.io"
        aria-label="githubへのリンク"
      >
        <IconButton aria-label="githubアイコン" color="default">
          <GitHubIcon />
        </IconButton>
      </a>
      <IconButton
        aria-label="delete"
        color="default"
        onClick={() => {
          drawerContext.setDrawerState(true);
        }}
      ></IconButton>
      {/* 下記はデモコードのリスト部分 */}
      <List>
        {["page1", "page2", "page3", "page4"].map((text, index) => (
          <ListItem button key={text}>
            <ListItemIcon>
              {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
            </ListItemIcon>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List>
      <Divider />
      <List>
        {["test", "test", "サイドメニュー"].map((text, index) => (
          <ListItem button key={text}>
            <ListItemIcon>
              {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
            </ListItemIcon>
            <ListItemText primary={text} />
          </ListItem>
        ))}
      </List>
    </>
  );
}
